import React from "react";

/**
 * @author
 * @function OnlineUsers
 **/

const OnlineUsers = (props) => {
  const { onUserSelect } = props;

  return (
    <div>
      <div className="online-users-header">
        <div style={{ margin: "0 10px" }}>Usuarios disponibles</div>
      </div>
      <ul className="users-list">
        <li onClick={()=> onUserSelect ("Yusdalis")}>
          <span style={{ textTransform:"capitalize"}}>Yusdalis</span>
          <span className="new-message-count">3</span>

        </li>
        <li>
          <span>Yusdalis</span>
          <span className="new-message-count">5</span>
        </li>
       
      </ul>
    </div>
  );
};

export default OnlineUsers;
